import styles from "./Footer.module.css"
import logo from "./LogoMain.png"
function Footer(){
    return(
        <footer className={styles.footer}>
            <section className={styles.footerContainer}>
                <img src={logo}/>
                {/* <h2>Desarrollado por Héctor Barrientos</h2>
                <h2>-2024-</h2> */}
            </section>
        </footer>
    )
}

export default Footer
